import collections
a = collections.deque()

def get_mins(n: int, k: int, data: list[int]):
    ans = []
    deq = [None] * k
    deq_pointer = 0
    for i in range(n):
        if not deq[0]:
            deq[0] = data[i]
            deq_pointer = 0
        else:
            if data[i] < deq[deq_pointer]:
                while data[i] < deq[deq_pointer]:
                    if deq_pointer == 0:
                        deq[0] = data[i]
                        deq_pointer -= 1
                        break
                    if deq[deq_pointer - 1] > data[i]:
                        deq[deq_pointer] = None
                    else:
                        deq[deq_pointer] = data[i]
                    deq_pointer -= 1
                deq_pointer += 1
            else:
                deq_pointer += 1
                deq[deq_pointer] = data[i]
        if i >= k - 1:
            ans.append(deq[0])
            if deq[0] == data[i + 1 - k]:
                deq.pop(0)
                deq.append(None)
                deq_pointer -= 1
    return ans


